import { connect } from "react-redux";
import { Card  } from 'react-bootstrap';
import * as actions from "../../store/actions/index.js";

class ShowInfo extends Component {

    componentDidMount() {
        this.props.fetchPokemonData();
      }

      render() {
        const {pokemonInfo} = this.props;
        let showData = ''; 

