              //     </Card.Body>
              //   </Card>
              // </div>
              <p></p>
            )
          })
        }
        // console.log(showData)
      
        return (
          <div className="App">
            {showData}
          </div>
        );
      }

}

const mapStateToProps = state => {
    return {
      pokemonInfo: state.pokemon.pData
    };
  };
  
  const mapDispatchToProps = dispatch => {
    return {
      fetchPokemonData: () => {
        dispatch(actions.fetchPokemonData());
      },
    };
  };
  
  export default connect(
    mapStateToProps,
    mapDispatchToProps
  )(ShowInfo);
